@Component({
  templateUrl: "./main-page.component.html",
  styleUrls: ["main-page.component.scss"],
})
export class MainPageComponent {}
<div class="page-wrapper main-page">
  <div class="card">Users</div>
  <div class="card">Todos</div>
</div>
